import React from "react";

import "./components/Home.css";

function Home() {
  return (
    <div className="fluid-container container1">
      <div className="row">
        <div
          className="content col-lg-12"
          style={{ border: "1px solid black" }}
        >
          <h1>Shopping Website</h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
